import { YOUTUBEURL, apiKey } from './apis';

export async function getMovieList(movieId) {
  const moviesId = movieId.rep
  return await fetch(`
        ${YOUTUBEURL}videos?key=${apiKey}&id=${movieId}&maxResults=15&part=id,snippet
    `).then((res) => res.json());
}
